import ReactPlayer from 'react-player'

const previewContent = [
    {
        img: "light-animation",
        title: "Home Light Animation",
        sticker: "",
        className: "",
        routerPath: "/home-light-animation",
        delayAnimation: "",
    },
    {
        img: "home-typer",
        title: "Home Typer Creative",
        sticker: "New",
        className: "sticker",
        routerPath: "/home-typer-creative",
        delayAnimation: "100",
    },

    {
        img: "dark-animation",
        title: "Home Dark Animation",
        sticker: "",
        className: "",
        routerPath: "/home-dark-animation",
        delayAnimation: "100",
    },
    {
        img: "home-parallax-typer",
        title: "Home Parallax & Typer",
        sticker: "New",
        className: "sticker",
        routerPath: "/home-parallax-typer",
        delayAnimation: "",
    },
];

const Video1 = () => {
    document.body.classList.add("light");
    return (
        <div className="beny_tm_intro_wrapper">
            <div className='player-wrapper'>
                <ReactPlayer
                    className='react-player fixed-bottom'
                    url= 'assets/videos/1.mp4'
                    width='100%'
                    height='100%'
                    controls = {true}
                />
            </div>
        </div>
    );
};

export default Video1;
